myApp.animation('.page-container', [function() {
    return {
        enter: function(element, doneFn) {

                $(element).velocity("transition.slideRightIn", {
                    complete: function() {
                        setTimeout(doneFn, 600);
                    },
                    duration: 500
                });

            // remember to call doneFn so that AngularJS
            // knows that the animation has concluded
        },

        move: function(element, doneFn) {
            doneFn();
        },

        leave: function(element, doneFn) {
            $(element).velocity('transition.slideLeftOut', {
                complete: doneFn,
                duration: 200
            });
        }
    }
}]);


myApp.controller('mainController', ['$scope', '$location', function ($scope, $location) {

    $scope.menuOpen = false;

    // toggle mobile menu open and closed
    $scope.toggleMenu = function() {
        var transition = ($scope.menuOpen) ? 'transition.slideLeftOut' : 'transition.slideLeftIn';
        $('nav').velocity(transition, {
            duration: 200
        });
        $scope.menuOpen = !$scope.menuOpen;
    };

    // close menu on link clicks
    $scope.closeMenu = function() {
        if($scope.menuOpen) {
            $('nav').velocity('transition.slideLeftOut', {
                duration: 200
            });
            $scope.menuOpen = false;
        }
    }
}]);




